import '../styles/create.css'

import { Link } from "react-router-dom"

export default function Create() {
  return (
    <div>
      <div style={{ height: '100px', border: '1px solid', margin: '5px' }}><Link to="/create-vote">创建单选</Link></div>
      <div style={{ height: '100px', border: '1px solid', margin: '5px' }}><Link to="/create-vote?multiple=1">创建多选</Link></div>
    </div>
  )
}
